@import '../../css/element.scss';
.panel{
    @include panel;
    .content{
        @include flex(row);
        box-sizing: border-box;
        padding-bottom: 40px;
        .item{
            width: 20%;
            text-align: center;
            img{
                width: 90px;
                height: 90px;
            }
            p{
                font-size: 26px;
                color: #666;
                text-overflow: ellipsis;
                white-space: nowrap;
                overflow: hidden;
                margin-top: 12px;
                &:nth-child(3){
                    color: #ff801a;
                    font-size: 20px;
                }
            }
        }
    }
}
